pub enum Action {
    Boxed(Box<Fn(&mut EditorState) -> ()>),
    Static(&'static Fn(&mut EditorState) -> ()),
    Chord(HashMap<KeyEvent, Arc<Action>>),
    NoOp(),
}

pub enum Motion {
    Relative(i16, i16),
    WindowPos(i16, i16),
    FilePos(i16, i16),
}

pub enum WindowSet {
    Window(Window),
    Vertical(Vec<WindowSet>, Area),
    Horizontal(Vec<WindowSet>, Area),
}
